import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import Myweek from './Myweek';
import Detail from './Detail';

function App() {

    const [day, setDay] = React.useState(['MON', 'TUE', 'WED', 'THU', 'FRI', 'SAT', 'SUN']);

    return (
        <div className="App">
            <div style={{
                width: "550px",
                height: "800px",
                border: "1px solid lightgrey",
                margin: "80px auto",
                borderRadius: "15px",
            }} >
                <div style={{
                    width: "400px",
                    margin: "90px auto",
                }}>
                    <h3 style={{
                        margin: "40px auto",
                    }}>How you feel today?</h3>
                    <Routes>
                        <Route path="/" element={<Myweek day={day} />}>
                        </Route>
                        <Route path="/detail" element={<Detail />}>
                        </Route>
                    </Routes>
                </div>
            </div>
        </div>
    );
}

export default App;
